import logo from './logo.svg';
import './App.css';
import NodeTable from './components/NodeTable'
import { MDBContainer } from 'mdb-react-ui-kit';

function App() {
  return (
    <div className="App">
      <MDBContainer>
        <p className="fs-1">Chia Node List</p>
        <NodeTable />
      </MDBContainer>
    </div>
  );
}

export default App;
